import React from 'react';
import './BoxLinks.css';
import { Link } from 'react-router-dom';

const BoxLinks = () => {
    return (
        <div className="box-links">
            <Link to="/projects" className="box">Projects</Link>
            <Link to="/social-media" className="box">Social Media</Link>
            <Link to="/certificates" className="box">Certificates</Link>
        </div>
    );
};

export default BoxLinks;
